/// <summary>
/// Overrides the base method to specify the menu item to be used
/// for Eastern European cash order reports.
/// </summary>
/// <returns>
/// The output menu item name.
/// </returns>
protected MenuItemName getMenuItemName()
{
    return menuitemoutputstr(CashOrderReport);
}
